import * as React from 'react'
import AddFriend from './AddFriend'
import FriendList from './FriendList'
import {UserContext} from './Conversations'
/**
 * Componente raíz para renderizar la lista de amigos y el componente para añadir amigos
 */
export default function FriendsPanel(props: any) {
    return (
        <UserContext.Consumer>
            {value => (
                <div>
                    <FriendList user={value} />
                    <AddFriend />
                </div>
            )}
        </UserContext.Consumer>
    )
}
